import logo from './logo.svg';
import './App.css';
import Home from './pages/Home';
function App() {
  return (
    <div className="App">
        <Router>
          <Switch>
              <Route path="/" exact component={Home} />
          </Switch>
        </Router>
    </div>
  );
}

export default App;
